import { Card } from 'antd';
import { Image } from 'antd';

export class Profile extends Component {
    render() {
        return (
          <div className="">
              {/* Breadcrumb */}
              <div class="row">
                  <div class="col-sm-12">
                      <div class="page-title-box">
                          <div class="row">
                              <div class="col">
                                  <h4 class="page-title">Profile</h4>
                                  <ol class="breadcrumb">
                                      <li class="breadcrumb-item"><a href="/books/profile">Profile</a></li>
                                      <li class="breadcrumb-item active">Joan Louji</li>
                                  </ol>
                              </div>
                          </div>
                      </div>
                  </div>
              </div>
              {/* Content */}
              <div className="">
                <Card title="Joan Louji" style={{ width: 400, height: 500 }}>
                  <p>Card content</p>
                  <p>Card content</p>
                  <p>Card content</p>
                </Card>
              </div>
          </div>
        )
    }
}

export default  Profile;
